const mainCarousel=new Carousel(document.querySelector("#mainCarousel"),{Dots:!1}),thumbCarousel=new Carousel(document.querySelector("#thumbCarousel"),{Sync:{target:mainCarousel,friction:0},Dots:!1,Navigation:!1,center:!0,slidesPerPage:1,infinite:!1});Fancybox.bind('[data-fancybox="gallery"]',{Carousel:{on:{change:e=>{mainCarousel.slideTo(mainCarousel.findPageForSlide(e.page),{friction:0})}}}});